
let image = new Image()
image.src = 'data:image/jpeg;base64,'
let particlesarray = []
let canvas = document.getElementById("canvas");
let ctx = canvas.getContext("2d", { willReadFrequently: true })
let style = document.getElementById('style')
style.value = 'bandwnotrails'
let mappedimage = []
let numberofparticles = 7000
canvas.width = 600;
canvas.height = 600;


if (window.innerWidth < 450) {
  canvas.width = (0.8)* window.innerWidth;
  canvas.height = canvas.width;

}

if (window.innerWidth > window.innerHeight && window.innerWidth <= 400) {
  // it is in iframe of my canvas websiste
  document.getElementById('custom').style.display = 'none';
  canvas.height = window.innerHeight;
  canvas.width = canvas.height;
  canvas.style.height = `${canvas.height}px`
  canvas.style.width = `${canvas.height}px`
  numberofparticles = 3000
  

}
else {     //it is not in iframe
  
}
image.addEventListener('load', function() {

  getimagedata()

  init()

  function animate() {
    if (style.value == 'color' || style.value == 'bandw' || style.value == 'colorcurves') {
      ctx.globalAlpha = 0.05
      ctx.fillStyle = 'rgb(0,0,0)'
      ctx.fillRect(0, 0, canvas.width, canvas.height)
      ctx.globalAlpha = 0.2
      for (i = 0; i < particlesarray.length; i++) {
        particlesarray[i].update()
        ctx.globalAlpha = particlesarray[i].speed * 0.2
        particlesarray[i].draw()
      }
    }
    if (style.value == 'bandwnotrails') {
      ctx.globalAlpha = 1
      ctx.fillStyle = 'black'
      ctx.fillRect(0, 0, canvas.width, canvas.height)
      for (i = 0; i < particlesarray.length; i++) {
        particlesarray[i].update()
        particlesarray[i].draw()
      }
    }


    window.requestAnimationFrame(animate)
  }
  animate()

})
function getimagedata() {

  ctx.drawImage(image, 0, 0, canvas.width, canvas.height)
  let pixels = ctx.getImageData(0, 0, canvas.width, canvas.height)
  ctx.clearRect(0, 0, canvas.width, canvas.height)
  mappedimage = []
  for (let y = 0; y < canvas.height; y++) {
    let row = []
    for (let x = 0; x < canvas.width; x++) {
      let red = pixels.data[(y * 4 * pixels.width) + (x * 4)]
      let green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]
      let blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]
      let brightness = getbrightness(red, green, blue)
      let cell = [brightness, `rgb(${red},${green},${blue})`]
      row.push(cell)
    }
    mappedimage.push(row)
  }
}
function getbrightness(red, green, blue) {
  if (style.value == 'bandw') {

    return Math.sqrt(
      (red * red) * 0.5 +
      (green * green) * 0.5 +
      (blue * blue) * 0.5
    ) / 100
  }
  if (style.value == 'color' || style.value == 'colorcurves') {
    return Math.sqrt(
      (red * red) * 0.299 +
      (green * green) * 0.587 +
      (blue * blue) * 0.114
    ) / 100
  }
  if (style.value == 'bandwnotrails') {
    return Math.sqrt(
      (red * red) * 2 +
      (green * green) * 2 +
      (blue * blue) * 1
    ) / 100
  }

}
style.onchange = function() {
  ctx.clearRect(0, 0, canvas.width, canvas.height)
  particlesarray = []
  init()
  getimagedata()
  for (i = 0; i < particlesarray.length; i++) {
    particlesarray[i].reset()

  }
}
function init() {
  for (i = 0; i < numberofparticles; i++) {
    particlesarray.push(new particle())
  }
}
class particle {
  constructor() {
    this.x = Math.random() * canvas.width
    this.y = 0
    this.velocity = Math.random() * 3.5
    this.posx = Math.floor(this.x)
    this.posy = Math.floor(this.y)
    this.speed = 0
    this.angle = 0
    this.size = Math.random() * 2
  }
  update() {
    this.angle += 0.1
    this.posx = Math.floor(this.x)
    this.posy = Math.floor(this.y)
    this.speed = mappedimage[this.posy][this.posx][0]
    let movement = (2.5 - this.speed) + this.velocity
    this.y += movement
    if (style.value == 'colorcurves') {

      this.x += Math.sin(this.angle)
      if (this.x >= canvas.width || this.x < 0) {
        this.x = 0
        this.y = Math.random() * canvas.height
      }
    }
    if (this.y > canvas.height) {
      this.y = 0
      this.x = Math.random() * canvas.width
    }
  }
  draw() {

    if (style.value == 'color' || style.value == 'colorcurves') {
      ctx.beginPath()
      ctx.fillStyle = mappedimage[this.posy][this.posx][1]
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2)
      ctx.fill()
    }

    if (style.value == 'bandwnotrails' || style.value == 'bandw') {
      ctx.beginPath()
      ctx.fillStyle = 'white'
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2)
      ctx.fill()
    }


  }
  reset() {
    this.x = Math.random() * canvas.width
    this.y = 0
    this.velocity = Math.random() * 3.5
    this.posx = Math.floor(this.x)
    this.posy = Math.floor(this.y)
    this.speed = 0
    this.angle = 0
    this.size = Math.random() * 2
  }
  

}